create view donation_list as select d.id, d.amount_in_pence, d.donation_date, g.wishes_to_gift_aid, d.donor_id, d.sponsor_form_id, d.charity_id
from donation d
left join gift_aid_donation g
on d.id = g.donation_id;

create view donation_report_temp as select charity_id, wishes_to_gift_aid, sum (amount_in_pence) as donation_sum
from donation_list
group by charity_id, wishes_to_gift_aid
order by charity_id, wishes_to_gift_aid;

create view donation_report_ga_temp as select charity_id, sum(donation_sum) as total_gift_aid from donation_report_temp where wishes_to_gift_aid = 1 group by charity_id;

select charity_id, sum(donation_sum)
from donation_report_temp
group by charity_id;

update charity_total ct
set ct.total_gift_aid = (select total_gift_aid from donation_report_ga_temp where charity_id=ct.charity_id);

update charity_total ct
set ct.total_before_gift_aid = total_after_gift_aid - total_gift_aid;

